const Log = (window.newrelic && window.newrelic.addPageAction ? window.newrelic.addPageAction : () => {
})

export const PAGES = {
    USER: 'USER',
    BUSINESS: 'BUSINESS',
    EMOJI: 'EMOJI',
    STATE: 'STATE',
    QUESTION: 'QUESTION',
    DIALOG: 'DIALOG',
    MODULE: 'MODULE',
    SUBMODULE: 'SUBMODULE',
}

export const ACTIONS = {
    EDIT: 'EDIT',
    ADD: 'add',
    REMOVE: 'REMOVE',
    LIST: 'LIST',
}

export function LogPageView(page, action, params) {
    Log(`${page}_${action}`, params);
}

export function LogError(page, action, params) {
    Log(`ERROR`, {
        page: params.page,
        action: params.action,
        link: location.href
    })
}

export function LogErrorRequest(params) {
    Log(`ERROR_REQUEST`, params)
}

export function LogErrorAuth(params) {
    Log(`ERROR_AUTH`, params)
}
